import xml.etree.ElementTree as ET

# XML 파일 경로


def run(file_paths,save_file,ParentNames,allowedDefs='',disallowedSpecialFilters=''):
    # 결과 저장 리스트
    def_names = []
    
    if isinstance(file_paths, list):
        pass
    elif isinstance(file_paths, str):
        file_paths=[file_paths]
    else:
        print("file_paths 리스트도 문자열도 아닙니다.")
        return
        
    if isinstance(ParentNames, list):
        pass
    elif isinstance(ParentNames, str):
        ParentNames=[ParentNames]
    else:
        print("ParentNames 리스트도 문자열도 아닙니다.")
        return
        
    for file_path in file_paths:
        # XML 파싱
        tree = ET.parse(file_path)
        root = tree.getroot()

        # ThingDef 요소 순회
        for thing in root.findall('.//ThingDef'):
            if thing.get('ParentName') in ParentNames:
                def_name_elem = thing.find('defName')
                if def_name_elem is not None:
                    def_names.append(def_name_elem.text)

    # 결과 출력
    # targetCount 에 반복 갯수
    # 정해진 작업
    # repeatMode:TargetCount
    # 설정한 횟수
    # repeatMode:RepeatCount
    with open(save_file, "w", encoding="utf-8") as file:
        file.write('Version:2\n')
        for name in def_names:
            print(name)
            file.write(f'''bill:Make_{name}
recipeDefNameUft:Make_{name}
skillRange:0~20
suspended:False
ingSearchRadius:999
storeMode:DropOnFloor
repeatMode:TargetCount
repeatCount:1
targetCount:1
includeEquipped:False
includeTainted:False
limitToAllowedStuff:False
pauseWhenSatisfied:False
unpauseWhenYouHave:5
hpRange:0~1
qualityRange:Awful~Legendary
slavesOnly:False
mechsOnly:False
nonMechsOnly:False
ingredientFilter:
allowedDefs:{allowedDefs}
allowedHitPointsPercents:0.0000:1.0000
allowedQualities:Awful:Legendary
disallowedSpecialFilters:{disallowedSpecialFilters}
---:---
''')

